css:
.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: #41505e;
  padding: 8px;
  border-bottom: 1px solid #2a2f38;
}
.github-Accordion-header::-webkit-details-marker {
  color: #41505e;
}
.github-Accordion-content {
  border-bottom: 1px solid #2a2f38;
  background-color: #181d23;
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: #41505e;
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: #b7c5d3;
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 4px;
  border-bottom: 1px solid #2a2f38;
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: #1a2026;
}
